import img1 from "../img/img1.png";
import img2 from "../img/img2.png";
import img3 from "../img/img3.png";
import img4 from "../img/img4.png";

export const Followers = [
  { name: "Nasrul", username: "Nasrul", img: img1 },
  { name: "Hana", username: "Hana", img: img2 },
  { name: "Doni", username: "Doni", img: img3 },
  { name: "martin braithwaite", username: "martin braithwaite", img: img4 },
];
